mongodb create index or multiple collection?<p>I have a collection that will insert a few million documents every year. My collection looks like this (using mongoose):</p>
<pre><code>var mongoose = require(&quot;mongoose&quot;);
var Schema = mongoose.Schema;

var MySchema = new Schema({    
    schoolID: {
        type: mongoose.Schema.Types.ObjectId, ref: 'School'
    },
    kelasID: {
        type: mongoose.Schema.Types.ObjectId, ref: 'Kelas'
    },
    studentID: {
        type: mongoose.Schema.Types.ObjectId, ref: 'Students'
    },
    positiveID: {
        type: mongoose.Schema.Types.ObjectId, ref: 'Positive'
    },
    teacherID: {
        type: mongoose.Schema.Types.ObjectId, ref: 'User'
    },
    actionName: {
        type: String,
    },
    actionDate: {
        type: String
    },   
    actionTime: {
        type: String
    },  
    actionMonth: {
        type: Number
    }, 
    actionYear: {
        type: Number
    }, 
    points: {
        type: Number
    },
    multiply: { 
        type: Number
    },
    totalPoints: {
        type: Number
    },
    dataType: {
        type: Number,
        default: 1  //1-normal, 2-attendance, 3-notifications, 4-parent app
    },
    remarks: {
        type: String,
    },  
    remarks2: {
        type: String,
    },  
    status: {
        type: Number,   //28 Dec 2018: Currently only used when dataType=2 (attendance). 1:On-Time, 2:Late
    }, 
});
MySchema.index({ schoolID : 1}, {kelasID : 1}, {studentID : 1}, {positiveID : 1}, {actionDate : 1})

module.exports = mongoose.model('Submission', MySchema);
</code></pre>
<p>As the document grows, querying data from it are getting slower. I have been thinking of manually creating a new collection for each year starting next year (so it would be named <code>Submission2021</code>, <code>Submission2022</code> and so on), but to do this I need to modify quite a lot of code, not to mention the hassle of doing something like</p>
<pre><code>var mySubmission;
if (year = 2021){
    mySubmission = new Submission2021();
}else if (year = 2022)
    mySubmission = new Submission2022();
}else if (year = 2023)
    mySubmission = new Submission2032();
}
mySubmission.schoolID = 123
mySubmission.kelasID = 321
mySubmission.save()
</code></pre>
<p>So will doing index based on <code>year</code> would be better for me? But my query will involve a lot of searching through either <code>schoolID</code>, <code>kelasID</code>, <code>studentID</code>, <code>positiveID</code>, <code>teacherID</code>, <code>actionDate</code>, so I don't think creating a compound index with year and the other fields inside the collection is a good idea right</p>

